import React from 'react';
import "./ArtCard.scss";

const artcard = (props) => {

    const Image = require('../../images/images/' + props.imagename + '.jpg');
    var style = {
        backgroundImage: `url(${Image})`,
        backgroundRepeat: "no-repeat",
        transform: "rotate(-45deg)"
    };

    return(
        <div className="artCard">
            <div style={style} className="ProdContainer">
                
            </div>
            <h4>{props.name}</h4>
            <p>{props.description}</p>
            <p>{props.price}</p>
        </div>
    );
}

export default artcard;

